SELECT MIN("lineorder"."lo_custkey") as agg_0, MAX("lineorder"."lo_orderdate") as agg_1 FROM "supplier" LEFT OUTER JOIN "lineorder" ON "supplier"."s_suppkey" = "lineorder"."lo_suppkey"  WHERE "supplier"."s_nation" LIKE '%KINGDOM%' AND "supplier"."s_region" != 'AMERICA' AND ("lineorder"."lo_orderpriority" = '2-HIGH' OR ("lineorder"."lo_orderpriority" IN ('3-MEDIUM', '5-LOW') AND "lineorder"."lo_orderpriority" NOT LIKE '%4-NOT%')) AND "lineorder"."lo_partkey" >= 136829